import { Div } from './Form.styled';

const Form = ({ state, onChange }) => {
  return (
    <Div>
      <label>
        {' '}
        Name
        <input name="name" value={state.name} onChange={onChange} />
      </label>
      <label>
        {' '}
        Email
        <input name="email" value={state.email} onChange={onChange} />
      </label>
      <label>
        {' '}
        Phone
        <input name="phone" value={state.phone} onChange={onChange} />
      </label>
      <label>
        {' '}
        Address
        <input name="address" value={state.address} onChange={onChange} />
      </label>
    </Div>
  );
};
export default Form;
